        <>
            <section className="Learnsec">
                <div className="div1">
                    <h1>Make your site better with Opus</h1>
                    <p>Lorem, ipsum dolor sit amet consectetur adipisicing elit. Distinctio nobis rerum quo voluptatibus. Sunt dicta enim, omnis pariatur harum officiis nobis voluptate a perferendis tempora eligendi quam, veritatis placeat expedita.</p>
                    <button className="btn btn-outline-primary btnContact w-40 bg-primary text-white" type="learnMore">Learn More</button>
                </div>
                <div className="moto">
                    <Arrow className="text-primary icon" />
                    <p>Build or Customize a Website in Minutes</p>
                    <RocketIcon className="text-primary icon" />
                    <p>Our UI Kit was made for creativity</p>
                </div>
            </section>
        </>
    );
};

export default learnMore;
